import './HomePageBody.css';
import CircleCard from './Card/CircleCard';
import Community from './CommunityIcon';


export default function HomePageBody() {
    return(
    <div className="body"> 
        <div className="communityRec">
            <CircleCard>
            <img src="./image/community.svg" alt="My SVG Icon" width="100" height="100" />
            </CircleCard>
        </div>
    </div>
           
    );
}
